import React from 'react'
import {BrowserRouter as Switch,Router,Route} from 'react-router-dom'
import Inicio from './pages/Inicio'



const App = () => {
  return (
    <Router>
      <Switch>
        <Route  path="/" component={Inicio} exact/>
      </Switch>
    </Router>
  )
}

export default App
